  [],\n\t\"revision_timestamp\": \"2016-10-08T15:55:56.252453\",\n\t\"name\": \"quaternary-geology-of-fish-springs-flat-juab-county-utah\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Fish Springs Flat is a sediment-filled
  valley between two tilted mountain blocks, the Thomas Range and the Fish Springs
  Range, in the Basin and Range physiographic province of western Utah. The valley
  is bordered on the north by the Great Salt Lake Desert and on the south by Whirlwind
  Valley. This report describes the surficial deposits of Quaternary age on the floor
  of Fish Springs Flat and along its peripheral piedmont slopes, an area of about
  330 miles2 (840 km2), which was mapped at a scale of 1:50,000. Surficial deposits
  in the map area consist of late-Pleistocene and Holocene alluvial fans and alluvium
  of ephemeral streams that drain the surrounding mountains, and lacustrine deposits
  of late-Pleistocene Lake Bonneville. Eolian sand dunes are locally important, and
  alluvial or playa mud covers the low parts of the valley at the north end. A prominent
  late-Holocene fault scarp parallels the front of the Fish Springs Range on the west
  side of the valley, and late Cenozoic pediments have developed along the flank of
  the Thomas Range on the east. Deposits and landforms of Lake Bonneville, especially
  of the Stansbury, Bonneville, and Provo shorelines, are well preserved in the Fish
  Springs Flat area and provide an excellent stratigraphic record of the lake.\",\n\t\"license_title\":
